B.Yj=new A.a_("\nSollte diese Anleitung nicht Ihrer Darstellung entsprechen m\xfcssen Sie den Link kopieren und in Safari (Standardbrowser IOS) einf\xfcgen.          \n\nDr\xfccken Sie auf den \u201eTeilen\u201c-Button (kleine Viereck mit dem Pfeil nach oben) -> Option -> zum Home-Bildschirm\n\nBeim ersten \xd6ffnen der App werden Sie gefragt, ob diese Ihnen Pushnachrichten senden darf. Bitte klicken Sie hier auf \u201eErlauben\u201c. Dies ist wichtig f\xfcr den vollen Funktionsumfang des Spiels!\n",null,B.dd,B.Y,null,null,null,null,null)
B.Yl=new A.a_("Au\xdferdem gibt es im Men\xfc noch zwei weitere spannende Features f\xfcr dich: Im Shop (1) kannst du mit den erspielten M\xfcnzen Sonderjellies kaufen. Au\xdferdem wartet t\xe4glich eine neue Belohnung darauf von dir abgeholt zu werden (2). Die Musik kann ebenfalls im Men\xfc ein- und ausgeschaltet werden (3)\n                                ",null,null,null,null,null,null,null,null)
