B.Yu=new A.a_("                  \nDie Installation funktioniert je nach Smartphone wie in Option 1 oder Option 2 beschrieben (siehe unten).\n                  \nUnabh\xe4ngig davon werden Sie beim ersten \xd6ffnen der App gefragt, ob diese Ihnen Pushnachrichten senden darf. Bitte klicken Sie hier auf \u201eZulassen\u201c. Dies ist wichtig f\xfcr den vollen Funktionsumfang des Spiels!",null,B.dd,B.Y,null,null,null,null,null)
